import { mock1 } from "./constants/mock";

export default function Resultados(numitems,items){
    return (<div>
      <h3>Timezone:{items.timezone}</h3>
      <h3>El tiempo en los próximos días será:</h3>
         <ul id="resultados">
          {items.resultados.map((item,index) => (
            <li>
              <p>{new Date(item.daily.dt * 1000).toLocaleDateString()}</p>
              {/* <p><img className="tiempoimg" src={"http://openweathermap.org/img/wn/${dia.weather[0].icon}.png"}/></p> */}
              <p>Temp: {item.daily.temp.day} </p>
              <p>Humedad: {item.daily.humidity}</p>
              <p>Viento: {item.daily.wind_speed}</p>
            </li>
          ))}
        </ul>

      </div>);
}
